function increasingTriplet(nums) {
  let output = false;
  let lowNum = Infinity
  let middle = Infinity;
  for (let i = 0; i < nums.length; i++){
    let current = nums[i];
    if (current <= lowNum){
      lowNum = current;
      //console.log("Updated lowNum:" + lowNum)
    } else if (current <= middle){
      middle = current
      //console.log("Updated middle:" + middle)
    } else  {
      console.log("You are reaching this step on this iteration " + current)
      output = true;
      break;
    }
  }
  return output;
}

